Caption:
Mural "hojas y flores"
En esta ocasión, me han dado la libertad para poder hacer este mural con detalles florales, en el que he disfrutado muchísimo y estoy súper agradecido.
La gran cantidad de luz y las dimensiones de este salón, son ideales para este tipo de diseños.
Personalmente estoy muy satisfecho con el resultado, se ha realizado con pintura acrílica mate para las hojas.
Y rotulador negro para las flores.
